import React, { Component} from "react";
import { Animate } from "react-move";
import images from "../assets/images/Images";

export default class Symbol extends Component {
  // eslint-disable-next-line no-useless-constructor
  constructor(props) {
    super(props);

  }
  getImage = () => {
    switch (this.props.symbol) {
      case "A":
        return images.America;
      case "G":
        return images.Aragon;
      case "N":
        return images.Argentina;
      case "S":
        return images.Assen;
      case "U":
        return images.Australia;
      case "C":
        return images.Catalunya;
      case "F":
        return images.Finland;
      case "R":
        return images.France;
      case "Y":
        return images.Germany;
      case "I":
        return images.Indonesia;
      case "J":
        return images.Japan;
      case "Z":
        return images.Jerez;
      case "M":
        return images.Malaysia;
      case "O":
        return images.Misano;
      case "L":
        return images.Mugello;
      case "T":
        return images.Osterreich;
      case "P":
        return images.Portugal;
      case "Q":
        return images.Qatar;
      case "H":
        return images.Thailand;
      case "K":
        return images.UK;
      case "D":
        return images.Fool;
      case "B":
        return images.Valencia;
      default:
        return images.Fool;
    }
  };

  render() {

    return (
      <div className="reelSymbol">
        <p>123</p>
     </div>
    );
  }
}
